import React from 'react'
import "./react-footer.css";

export default function ReactFooter() {
  return (
    <div className="footer">
      <div className="f-container">
          <div className="row">
            {/*Col-1*/}
            <div className="col-md-3 col-sm-6">
                <h4>This is Footer</h4>

            </div>
          </div>

      </div>
    </div>
  )
}
